så  här står det när jag försöker göra det, (MioStartUp-0725 och sen Clean all data in My flash disk.) ok eller nej då trycker jag nej, då står det (Error, No DM Found in HDD and SDMMC) sen när jag trycker OK blockerar den helt, jag har flashat min Mio till R23, vad kan det vara fel, nåt annat jag vill fråga dig, jag har laddat den Miomap v3.2 268+269+ norden kartor 2007-1 och det verkade funka på min Mio 269, sen tar jag en sväng och vill kola hur den funkar och så fick jag ett meddelande att jag har inte rät att använda den den e ilegal och sen
bara stängde av kartan, vad kan det vara för fel, om du kan detta och kan hjälpa skulle jag vara jätte tacksamt.
